import iphone1 from './img/iphone1.png';
import iphone2 from './img/iphone2.png';
import iphone3 from './img/iphone3.png';
import iphone4 from './img/iphone4.png';
import boba_logo from './img/milktea.png';
const images = [
    {
      original: 'img/iphone1.png'
    },
    {
      original: './img/iphone2.png'
    },
    {
      original: './img/iphone3.png'
    },
  ];

  class MyGallery extends React.Component {
    render() {
      return <ImageGallery items={images} showThumbnails={false}/>;
    }
